import { Paper, Stack } from "@mui/material";
import { Header } from "./Header";
import { InputFile } from "./InputFile";
import { makeStyles } from "@mui/styles";
import { TextInput } from "./TextInput";
import setBodyColor from "./setBody";
import { ButtonClick } from "./ButtonClick";
import { useState } from "react";
import { User } from "./models";

export const SignUp = () => {
  const classes = useStyles();

  setBodyColor({ color: "#DDFFF7" });

  const initialValue = {
    firstname: "",
    lastname: "",
    email: "",
    password: "",
    address: "",
    governmentId: "",
  };

  const [user, setUser] = useState<User>(initialValue);

  const handleFirstname = (value: string) => {
    setUser({ ...user, firstname: value });
  };

  const handleLastname = (value: string) => {
    setUser({ ...user, lastname: value });
  };

  const handleEmail = (value: string) => {
    setUser({ ...user, email: value });
  };

  const handlePassword = (value: string) => {
    setUser({ ...user, password: value });
  };

  const handleAddress = (value: string) => {
    setUser({ ...user, address: value });
  };

  const handleGovernmentId = (value: string) => {
    setUser({ ...user, governmentId: value });
  };

  return (
    <div>
      <Header />
      <Paper elevation={2} className={classes.form}>
        <h1 className={classes.title}>Registration form</h1>
        <Stack spacing={2} direction="row" className={classes.formContainer}>
          <Stack spacing={2} direction="column">
            <TextInput label="Firstname" onChange={handleFirstname} />
            <TextInput label="Lastname" onChange={handleLastname} />
            <TextInput label="Email" type="email" onChange={handleEmail} />
            <TextInput
              label="Password"
              type="password"
              onChange={handlePassword}
            />
          </Stack>
          <Stack spacing={2} direction="column">
            <TextInput label="Address" onChange={handleAddress} />
            <InputFile
              file={user.governmentId}
              accept="image/*"
              onChange={handleGovernmentId}
            />
          </Stack>
        </Stack>
        <Stack
          className={classes.submitButtonStack}
          spacing={2}
          direction="row"
          justifyContent="center"
        >
          <ButtonClick
            type="submit"
            variant="contained"
            backgroundColor="#FFA69E"
            size="large"
          >
            Sumbit
          </ButtonClick>
        </Stack>
      </Paper>
    </div>
  );
};

const useStyles = makeStyles({
  title: {
    display: "flex",
    justifyContent: "center",
  },
  form: {
    width: "600px",
    margin: "auto",
    marginTop: "150px",
    padding: "60px",
  },
  formContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  submitButtonStack: {
    marginTop: "12px",
  },
});
